import React from "react";
import { useNavigate } from "react-router-dom";
import "./SignInSelector.css"; // optional

const SignInSelector = () => {
  const navigate = useNavigate();

  return (
    <div className="selector-container">
      <h2>Choose Login Type</h2>
      <button onClick={() => navigate("/signin/user")}>User Login</button>
      <button onClick={() => navigate("/signin/admin")}>Admin Login</button>
    </div>
  );
};

export default SignInSelector;
